import React from 'react';


const Form2=()=>{
    return(
        <>
        <div style={{backgroundColor: 'gray' , display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center' }}>
            <form action="">
                <label htmlFor="">Hello</label><br />
                <input  type="text" 
                        name='fname'
                /><br />

                <input  type="text"
                        name='lname'
                 />
            </form>
            </div>
        </>
    )
}

export default Form2;
